css:
.diagnostics-ui-table-container {
  display: flex;
  flex-direction: column;
  overflow-y: hidden;
}
.diagnostics-ui-table-container > div:first-child {
  display: flex;
  overflow: hidden;
  flex-direction: column;
}
.diagnostics-ui-table-container .nuclide-ui-table {
  border-top-width: 0;
  border-left-width: 0;
  border-right-width: 0;
}
.diagnostics-ui-table-container .nuclide-ui-table td:last-child,
.diagnostics-ui-table-container .nuclide-ui-table th:last-child {
  border-right-width: 0;
}
.diagnostics-ui-table-container .nuclide-ui-table-body-cell {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
.diagnostics-ui-table-container .nuclide-ui-table-body-cell .diagnostics-full-description-message {
  white-space: normal;
}
.nuclide-ui-table-cell-text-align-right {
  text-align: right;
}
.diagnostics-ui-table-container-empty .nuclide-ui-table {
  border-bottom-width: 0;
}
.diagnostics-ui-table-message {
  text-align: center;
}
.diagnostics-ui-table-message.highlight-warning,
.diagnostics-ui-table-message.highlight-error {
  border-radius: 0;
  padding: 5px 0 10px 0;
}
.diagnostics-ui-empty-component {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
.nuclide-diagnostics-ui-dir-cell-contents {
  direction: rtl;
  overflow: hidden;
  text-overflow: ellipsis;
  opacity: 0.75;
  white-space: nowrap;
}
.nuclide-diagnostics-ui-cell-dir.nuclide-ui-table-body-cell {
  padding-right: 0;
  border-right: 0;
}
.nuclide-diagnostics-ui-cell-filename.nuclide-ui-table-body-cell {
  font-weight: 600;
}
.nuclide-diagnostics-ui-line-number {
  opacity: 0.5;
  font-weight: normal;
}
.nuclide-ui-table-row .nuclide-diagnostics-ui-cell-classification {
  text-align: center;
}
.nuclide-ui-table-row .nuclide-diagnostics-ui-cell-classification .icon::before {
  width: 14px;
  height: 14px;
  font-size: 14px;
  margin-right: 0;
}
.nuclide-ui-table:not(:focus) .nuclide-ui-table-row .nuclide-diagnostics-ui-cell-classification .icon,
.nuclide-ui-table-row:not(.nuclide-ui-table-row-selected) .nuclide-diagnostics-ui-cell-classification .icon {
  color: #1492ff;
}
.nuclide-ui-table:not(:focus) .nuclide-ui-table-row .nuclide-diagnostics-ui-cell-classification .icon-nuclicon-error,
.nuclide-ui-table-row:not(.nuclide-ui-table-row-selected) .nuclide-diagnostics-ui-cell-classification .icon-nuclicon-error {
  color: #f42a2a;
}
.nuclide-ui-table:not(:focus) .nuclide-ui-table-row .nuclide-diagnostics-ui-cell-classification .icon-nuclicon-warning,
.nuclide-ui-table-row:not(.nuclide-ui-table-row-selected) .nuclide-diagnostics-ui-cell-classification .icon-nuclicon-warning {
  color: #d5880b;
}
.nuclide-diagnostics-ui-settings-modal {
  flex-direction: column;
  padding: 10px;
}
